import React, { useState, useEffect } from "react";

const PageDescription = ({ pageId }) => {
  const [field, setField] = useState({});

  useEffect(() => {
    fetch(
      `https://dw-c3fe4d.ingress-daribow.ewp.live/wp-json/acf/v3/projects/${pageId}/description`,
      {
        mode: "no-cors",
      }
    )
      .then((response) => response.json())
      .then((data) => {
        console.log(data);
        setField(data);
      })
      .catch((error) => {
        console.log(error);
      });
  });

  return (
    <div>
      <h2>{field.field_name}</h2>
      <p>{field.field_value}</p>
    </div>
  );
};

export default PageDescription;
